import React from 'react'
import Login from './pages/Login';
import Navbar from './pages/Navbar'
import {Switch,Route} from "react-router-dom"

const App = () => {
  return (
    <>
      <Navbar></Navbar>
      <Switch>
        <Route path={'/'} exact component={Login}></Route>
      </Switch>
      <Login></Login>
    </>
  );
}

export default App
